def _init_mgr(self, mgr, axes=None, dtype=None, copy=False):
    """ passed a manager and a axes dict """
    for a, axe in axes.items():
        if axe is not None:
            mgr = mgr.reindex_axis(axe, axis=self._get_block_manager_axis(a), copy=False)
    if copy:
