            nv.validate_prod(tuple(), kwargs)
        else:
            nv.validate_stat_func(tuple(), kwargs, fname=name)
        if skipna is None:
            skipna = True
        if axis is None:
            axis = self._stat_axis_number
        if level is not None:
            return self._agg_by_level(
                name, axis=axis, level=level, skipna=skipna, min_count=min_count
            )
        return self._reduce(
            f,
            name,
            axis=axis,
            skipna=skipna,
            numeric_only=numeric_only,
            min_count=min_count,
        )

    return set_function_name(stat_func, name, cls)

def _make_stat_function(
    cls, name, name1, name2, axis_descr, desc, f, see_also: str = "", examples: str = ""
):
    @Substitution(
        desc=desc,
        name1=name1,
        name2=name2,
        axis_descr=axis_descr,
        min_count="",
        see_also=see_also,
        examples=examples,
    )
    @Appender(_num_doc)
    def stat_func(
        self, axis=None, skipna=None, level=None, numeric_only=None, **kwargs
    ):
        if name == "median":
            nv.validate_median(tuple(), kwargs)
        else:
            nv.validate_stat_func(tuple(), kwargs, fname=name)
        if skipna is None:
            skipna = True
        if axis is None:
            axis = self._stat_axis_number
        if level is not None:
            return self._agg_by_level(name, axis=axis, level=level, skipna=skipna)
        return self._reduce(
            f, name, axis=axis, skipna=skipna, numeric_only=numeric_only
        )

    return set_function_name(stat_func, name, cls)

def _make_stat_function_ddof(cls, name, name1, name2, axis_descr, desc, f):
    @Substitution(desc=desc, name1=name1, name2=name2, axis_descr=axis_descr)
    @Appender(_num_ddof_doc)
    def stat_func(
        self, axis=None, skipna=None, level=None, ddof=1, numeric_only=None, **kwargs
    ):
        nv.validate_stat_ddof_func(tuple(), kwargs, fname=name)
        if skipna is None:
            skipna = True
        if axis is None:
            axis = self._stat_axis_number
        if level is not None:
            return self._agg_by_level(
                name, axis=axis, level=level, skipna=skipna, ddof=ddof
            )
        return self._reduce(
            f, name, axis=axis, numeric_only=numeric_only, skipna=skipna, ddof=ddof
        )

    return set_function_name(stat_func, name, cls)

def _make_logical_function(
    cls, name, name1, name2, axis_descr, desc, f, see_also, examples, empty_value
):
    @Substitution(
        desc=desc,
        name1=name1,
        name2=name2,
        axis_descr=axis_descr,
        see_also=see_also,
        examples=examples,
        empty_value=empty_value,
    )
    @Appender(_bool_doc)
    def logical_func(self, axis=0, bool_only=None, skipna=True, level=None, **kwargs):
        nv.validate_logical_func(tuple(), kwargs, fname=name)
        if level is not None:
            if bool_only is not None:
                raise NotImplementedError(
                    "Option bool_only is not implemented with option level."
                )
            return self._agg_by_level(name, axis=axis, level=level, skipna=skipna)
        return self._reduce(
            f,
            name,
            axis=axis,
            skipna=skipna,
            numeric_only=bool_only,
            filter_type="bool",
        )

    return set_function_name(logical_func, name, cls)

def __init__(
    self,
    data: BlockManager,
    axes: Optional[List[Index]] = None,
    copy: bool = False,
    dtype: Optional[Dtype] = None,
    attrs: Optional[Mapping[Optional[Hashable], Any]] = None,
    fastpath: bool = False,
):

    if not fastpath:
        if dtype is not None:
            data = data.astype(dtype)
        elif copy:
            data = data.copy()

        if axes is not None:
            for i, ax in enumerate(axes):
                data = data.reindex_axis(ax, axis=i)

    object.__setattr__(self, "_is_copy", None)
    object.__setattr__(self, "_data", data)
    object.__setattr__(self, "_item_cache", {})
    if attrs is None:
        attrs = {}
    else:
        attrs = dict(attrs)
    object.__setattr__(self, "_attrs", attrs)

def _init_mgr(self, mgr, axes=None, dtype=None, copy=False):
    """ passed a manager and a axes dict """
    for a, axe in axes.items():
        if axe is not None:
            mgr = mgr.reindex_axis(
                axe, axis=self._get_block_manager_axis(a), copy=False
            )

    # make a copy if explicitly requested
    if copy:
        mgr = mgr.copy()
    if dtype is not None:
        # avoid further copies if we can
        if len(mgr.blocks) > 1 or mgr.blocks[0].values.dtype != dtype:
            mgr = mgr.astype(dtype=dtype)
    return mgr

@property
def attrs(self) -> Dict[Optional[Hashable], Any]:
    """
    Dictionary of global attributes on this object.

    .. warning::

       attrs is experimental and may change without warning.
    """
    if self._attrs is None:
        self._attrs = {}
    return self._attrs

@attrs.setter
def attrs(self, value: Mapping[Optional[Hashable], Any]) -> None:
    self._attrs = dict(value)

def _validate_dtype(self, dtype):
    """ validate the passed dtype """

    if dtype is not None:
        dtype = pandas_dtype(dtype)

        # a compound dtype
        if dtype.kind == "V":
            raise NotImplementedError(
                "compound dtypes are not implemented "
                f"in the {type(self).__name__} constructor"
            )

    return dtype

@property
def _constructor(self: FrameOrSeries) -> Type[FrameOrSeries]:
    """Used when a manipulation result has the same dimensions as the
    original.
    """
    raise AbstractMethodError(self)

@property
def _constructor_sliced(self):
    """Used when a manipulation result has one lower dimension(s) as the
    original, such as DataFrame single columns slicing.
    """
    raise AbstractMethodError(self)

@property
def _constructor_expanddim(self):
    """Used when a manipulation result has one higher dimension as the
    original, such as Series.to_frame()
    """
    raise NotImplementedError

def _construct_axes_dict(self, axes=None, **kwargs):
    """Return an axes dictionary for myself."""
    d = {a: self._get_axis(a) for a in (axes or self._AXIS_ORDERS)}
    d.update(kwargs)
    return d

def _construct_axes_from_arguments(
    self, args, kwargs, require_all: bool = False, sentinel=None
):
    """Construct and returns axes if supplied in args/kwargs.

    If require_all, raise if all axis arguments are not supplied
    return a tuple of (axes, kwargs).

    sentinel specifies the default parameter when an axis is not
    supplied; useful to distinguish when a user explicitly passes None
    in scenarios where None has special meaning.
    """

    # construct the args
    args = list(args)
    for a in self._AXIS_ORDERS:

        # look for a argument by position
        if a not in kwargs:
            try:
                kwargs[a] = args.pop(0)
            except IndexError:
                if require_all:
                    raise TypeError("not enough/duplicate arguments specified!")

    axes = {a: kwargs.pop(a, sentinel) for a in self._AXIS_ORDERS}
    return axes, kwargs

@classmethod
def _get_axis_number(cls, axis):
    axis = cls._AXIS_ALIASES.get(axis, axis)
    if is_integer(axis):
        if axis in cls._AXIS_NAMES:
            return axis
    else:
        try:
            return cls._AXIS_NUMBERS[axis]
        except KeyError:
            pass
    raise ValueError(f"No axis named {axis} for object type {cls}")

@classmethod
def _get_axis_name(cls, axis):
    axis = cls._AXIS_ALIASES.get(axis, axis)
    if isinstance(axis, str):
        if axis in cls._AXIS_NUMBERS:
            return axis
    else:
        try:
            return cls._AXIS_NAMES[axis]
        except KeyError:
            pass
    raise ValueError(f"No axis named {axis} for object type {cls}")

def _get_axis(self, axis):
    name = self._get_axis_name(axis)
    return getattr(self, name)

@classmethod
def _get_block_manager_axis(cls, axis):
    """Map the axis to the block_manager axis."""
    axis = cls._get_axis_number(axis)
    if cls._AXIS_REVERSED:
        m = cls._AXIS_LEN - 1
        return m - axis
    return axis

def _get_index_resolvers(self) -> Dict[str, ABCSeries]:
    from pandas.core.computation.parsing import clean_column_name

    d: Dict[str, ABCSeries] = {}
    for axis_name in self._AXIS_ORDERS:
        d.update(self._get_axis_resolvers(axis_name))

    return {clean_column_name(k): v for k, v in d.items() if not isinstance(k, int)}

def _get_cleaned_column_resolvers(self) -> Dict[str, ABCSeries]:
    """
    Return the special character free column resolvers of a dataframe.

    Column names with special characters are 'cleaned up' so that they can
    be referred to by backtick quoting.
    Used in :meth:`DataFrame.eval`.
    """
    from pandas.core.computation.parsing import clean_column_name

    if isinstance(self, ABCSeries):
        return {clean_column_name(self.name): self}

    return {
        clean_column_name(k): v for k, v in self.items() if not isinstance(k, int)
    }

@property
def _info_axis(self):
    return getattr(self, self._info_axis_name)

@property
def _stat_axis(self):
    return getattr(self, self._stat_axis_name)

@property
def shape(self) -> Tuple[int, ...]:
    """
    Return a tuple of axis dimensions
    """
    return tuple(len(self._get_axis(a)) for a in self._AXIS_ORDERS)

@property
def _selected_obj(self: FrameOrSeries) -> FrameOrSeries:
    """ internal compat with SelectionMixin """
    return self

@property
def _obj_with_exclusions(self: FrameOrSeries) -> FrameOrSeries:
    """ internal compat with SelectionMixin """
    return self

def _set_axis(self, axis, labels) -> None:
    self._data.set_axis(axis, labels)
    self._clear_item_cache()

def swapaxes(self: FrameOrSeries, axis1, axis2, copy=True) -> FrameOrSeries:
    """
    Interchange axes and swap values axes appropriately.

    Returns
    -------
    y : same as input
    """
    i = self._get_axis_number(axis1)
    j = self._get_axis_number(axis2)

    if i == j:
        if copy:
            return self.copy()
        return self

    mapping = {i: j, j: i}

    new_axes = (self._get_axis(mapping.get(k, k)) for k in range(self._AXIS_LEN))
    new_values = self.values.swapaxes(i, j)
    if copy:
        new_values = new_values.copy()

    return self._constructor(new_values, *new_axes).__finalize__(self)

def _indexed_same(self, other) -> bool:
    return all(
        self._get_axis(a).equals(other._get_axis(a)) for a in self._AXIS_ORDERS
    )

def __neg__(self):
    values = com.values_from_object(self)
    if is_bool_dtype(values):
        arr = operator.inv(values)
    elif (
        is_numeric_dtype(values)
        or is_timedelta64_dtype(values)
        or is_object_dtype(values)
    ):
        arr = operator.neg(values)
    else:
        raise TypeError(f"Unary negative expects numeric dtype, not {values.dtype}")
    return self.__array_wrap__(arr)

def __pos__(self):
    values = com.values_from_object(self)
    if is_bool_dtype(values) or is_period_arraylike(values):
        arr = values
    elif (
        is_numeric_dtype(values)
        or is_timedelta64_dtype(values)
        or is_object_dtype(values)
    ):
        arr = operator.pos(values)
    else:
        raise TypeError(f"Unary plus expects numeric dtype, not {values.dtype}")
    return self.__array_wrap__(arr)

def __invert__(self):
    if not self.size:
        # inv fails with 0 len
        return self

    arr = operator.inv(com.values_from_object(self))
    return self.__array_wrap__(arr)

def __nonzero__(self):
    raise ValueError(
        f"The truth value of a {type(self).__name__} is ambiguous. "
        "Use a.empty, a.bool(), a.item(), a.any() or a.all()."
    )

def __hash__(self):
    raise TypeError(
        f"{repr(type(self).__name__)} objects are mutable, "
        f"thus they cannot be hashed"
    )

@Appender(items.__doc__)
def iteritems(self):
    return self.items()

def __len__(self) -> int:
    """Returns length of info axis"""
    return len(self._info_axis)

def __contains__(self, key) -> bool_t:
    """True if the key is in the info axis"""
    return key in self._info_axis

def __array_wrap__(self, result, context=None):
    result = lib.item_from_zerodim(result)
    if is_scalar(result):
        # e.g. we get here with np.ptp(series)
        # ptp also requires the item_from_zerodim
        return result
    d = self._construct_axes_dict(self._AXIS_ORDERS, copy=False)
    return self._constructor(result, **d).__finalize__(self)

def __getstate__(self) -> Dict[str, Any]:
    meta = {k: getattr(self, k, None) for k in self._metadata}
    return dict(
        _data=self._data,
        _typ=self._typ,
        _metadata=self._metadata,
        attrs=self.attrs,
        **meta,
    )

def __setstate__(self, state):

    if isinstance(state, BlockManager):
        self._data = state
    elif isinstance(state, dict):
        typ = state.get("_typ")
        if typ is not None:
            attrs = state.get("_attrs", {})
            object.__setattr__(self, "_attrs", attrs)

            # set in the order of internal names
            # to avoid definitional recursion
            # e.g. say fill_value needing _data to be
            # defined
            meta = set(self._internal_names + self._metadata)
            for k in list(meta):
                if k in state:
                    v = state[k]
                    object.__setattr__(self, k, v)

            for k, v in state.items():
                if k not in meta:
                    object.__setattr__(self, k, v)

        else:
            raise NotImplementedError("Pre-0.12 pickles are no longer supported")
    elif len(state) == 2:
        raise NotImplementedError("Pre-0.12 pickles are no longer supported")

    self._item_cache = {}

def _repr_latex_(self):
    """
    Returns a LaTeX representation for a particular object.
    Mainly for use with nbconvert (jupyter notebook conversion to pdf).
    """
    if config.get_option("display.latex.repr"):
        return self.to_latex()
    else:
        return None

def _reset_cacher(self) -> None:
    """Reset the cacher."""
    if hasattr(self, "_cacher"):
        del self._cacher

@property
def _is_cached(self) -> bool_t:
    """Return boolean indicating if self is cached or not."""
    return getattr(self, "_cacher", None) is not None

def _get_cacher(self):
    """return my cacher or None"""
    cacher = getattr(self, "_cacher", None)
    if cacher is not None:
        cacher = cacher[1]()
    return cacher

def _iget_item_cache(self, item):
    """Return the cached item, item represents a positional indexer."""
    ax = self._info_axis
    if ax.is_unique:
        lower = self._get_item_cache(ax[item])
    else:
        lower = self.take(item, axis=self._info_axis_number)
    return lower

def _set_item(self, key, value) -> None:
    self._data.set(key, value)
    self._clear_item_cache()

def _set_is_copy(self, ref, copy: bool_t = True) -> None:
    if not copy:
        self._is_copy = None
    else:
        assert ref is not None
        self._is_copy = weakref.ref(ref)

def __delitem__(self, key) -> None:
    """
    Delete item
    """
    deleted = False

    maybe_shortcut = False
    if self.ndim == 2 and isinstance(self.columns, MultiIndex):
        try:
            maybe_shortcut = key not in self.columns._engine
        except TypeError:
            pass

    if maybe_shortcut:
        # Allow shorthand to delete all columns whose first len(key)
        # elements match key:
        if not isinstance(key, tuple):
            key = (key,)
        for col in self.columns:
            if isinstance(col, tuple) and col[: len(key)] == key:
                del self[col]
                deleted = True
    if not deleted:
        # If the above loop ran and didn't delete anything because
        # there was no match, this call should raise the appropriate
        # exception:
        self._data.delete(key)

    # delete from the caches
    try:
        del self._item_cache[key]
    except KeyError:
        pass

@property
def _is_view(self):
    """Return boolean indicating if self is view of another array """
    return self._data.is_view

def drop(
    self,
    labels=None,
    axis=0,
    index=None,
    columns=None,
    level=None,
    inplace: bool_t = False,
    errors: str = "raise",
):

    inplace = validate_bool_kwarg(inplace, "inplace")

    if labels is not None:
        if index is not None or columns is not None:
            raise ValueError("Cannot specify both 'labels' and 'index'/'columns'")
        axis_name = self._get_axis_name(axis)
        axes = {axis_name: labels}
    elif index is not None or columns is not None:
        axes, _ = self._construct_axes_from_arguments((index, columns), {})
    else:
        raise ValueError(
            "Need to specify at least one of 'labels', 'index' or 'columns'"
        )

    obj = self

    for axis, labels in axes.items():
        if labels is not None:
            obj = obj._drop_axis(labels, axis, level=level, errors=errors)

    if inplace:
        self._update_inplace(obj)
    else:
        return obj

def _needs_reindex_multi(self, axes, method, level) -> bool_t:
    """Check if we do need a multi reindex."""
    return (
        (com.count_not_none(*axes.values()) == self._AXIS_LEN)
        and method is None
        and level is None
        and not self._is_mixed_type
    )

@Appender(_shared_docs["pipe"] % _shared_doc_kwargs)
def pipe(self, func, *args, **kwargs):
    return com.pipe(self, func, *args, **kwargs)

def __getattr__(self, name: str):
    """After regular attribute access, try looking up the name
    This allows simpler access to columns for interactive use.
    """

    # Note: obj.x will always call obj.__getattribute__('x') prior to
    # calling obj.__getattr__('x').

    if (
        name in self._internal_names_set
        or name in self._metadata
        or name in self._accessors
    ):
        return object.__getattribute__(self, name)
    else:
        if self._info_axis._can_hold_identifiers_and_holds_name(name):
            return self[name]
        return object.__getattribute__(self, name)

def __setattr__(self, name: str, value) -> None:
    """After regular attribute access, try setting the name
    This allows simpler access to columns for interactive use.
    """

    # first try regular attribute access via __getattribute__, so that
    # e.g. ``obj.x`` and ``obj.x = 4`` will always reference/modify
    # the same attribute.

    try:
        object.__getattribute__(self, name)
        return object.__setattr__(self, name, value)
    except AttributeError:
        pass

    # if this fails, go on to more involved attribute setting
    # (note that this matches __getattr__, above).
    if name in self._internal_names_set:
        object.__setattr__(self, name, value)
    elif name in self._metadata:
        object.__setattr__(self, name, value)
    else:
        try:
            existing = getattr(self, name)
            if isinstance(existing, Index):
                object.__setattr__(self, name, value)
            elif name in self._info_axis:
                self[name] = value
            else:
                object.__setattr__(self, name, value)
        except (AttributeError, TypeError):
            if isinstance(self, ABCDataFrame) and (is_list_like(value)):
                warnings.warn(
                    "Pandas doesn't allow columns to be "
                    "created via a new attribute name - see "
                    "https://pandas.pydata.org/pandas-docs/"
                    "stable/indexing.html#attribute-access",
                    stacklevel=2,
                )
            object.__setattr__(self, name, value)

def _dir_additions(self):
    """ add the string-like attributes from the info_axis.
    If info_axis is a MultiIndex, it's first level values are used.
    """
    additions = {
        c
        for c in self._info_axis.unique(level=0)[:100]
        if isinstance(c, str) and c.isidentifier()
    }
    return super()._dir_additions().union(additions)

def _consolidate_inplace(self) -> None:
    """Consolidate data in place and return None"""

    def f():
        self._data = self._data.consolidate()

    self._protect_consolidate(f)

@property
def _is_mixed_type(self):
    f = lambda: self._data.is_mixed_type
    return self._protect_consolidate(f)

@property
def _is_numeric_mixed_type(self):
    f = lambda: self._data.is_numeric_mixed_type
    return self._protect_consolidate(f)

def _check_inplace_setting(self, value) -> bool_t:
    """ check whether we allow in-place setting with this type of value """

    if self._is_mixed_type:
        if not self._is_numeric_mixed_type:

            # allow an actual np.nan thru
            if is_float(value) and np.isnan(value):
                return True

            raise TypeError(
                "Cannot do inplace boolean setting on "
                "mixed-types with a non np.nan value"
            )

    return True

@property
def _values(self) -> np.ndarray:
    """internal implementation"""
    return self.values

def _to_dict_of_blocks(self, copy: bool_t = True):
    """
    Return a dict of dtype -> Constructor Types that
    each is a homogeneous dtype.

    Internal ONLY
    """
    return {
        k: self._constructor(v).__finalize__(self)
        for k, v, in self._data.to_dict(copy=copy).items()
    }

@Appender(_shared_docs["replace"] % _shared_doc_kwargs)
def replace(
    self,
    to_replace=None,
    value=None,
    inplace=False,
    limit=None,
    regex=False,
    method="pad",
):
    inplace = validate_bool_kwarg(inplace, "inplace")
    if not is_bool(regex) and to_replace is not None:
        raise AssertionError("'to_replace' must be 'None' if 'regex' is not a bool")

    self._consolidate_inplace()

    if value is None:
        # passing a single value that is scalar like
        # when value is None (GH5319), for compat
        if not is_dict_like(to_replace) and not is_dict_like(regex):
            to_replace = [to_replace]

        if isinstance(to_replace, (tuple, list)):
            if isinstance(self, ABCDataFrame):
                return self.apply(
                    _single_replace, args=(to_replace, method, inplace, limit)
                )
            return _single_replace(self, to_replace, method, inplace, limit)

        if not is_dict_like(to_replace):
            if not is_dict_like(regex):
                raise TypeError(
                    'If "to_replace" and "value" are both None '
                    'and "to_replace" is not a list, then '
                    "regex must be a mapping"
                )
            to_replace = regex
            regex = True

        items = list(to_replace.items())
        keys, values = zip(*items) if items else ([], [])

        are_mappings = [is_dict_like(v) for v in values]

        if any(are_mappings):
            if not all(are_mappings):
                raise TypeError(
                    "If a nested mapping is passed, all values "
                    "of the top level mapping must be mappings"
                )
            # passed a nested dict/Series
            to_rep_dict = {}
            value_dict = {}

            for k, v in items:
                keys, values = list(zip(*v.items())) or ([], [])

                to_rep_dict[k] = list(keys)
                value_dict[k] = list(values)

            to_replace, value = to_rep_dict, value_dict
        else:
            to_replace, value = keys, values

        return self.replace(
            to_replace, value, inplace=inplace, limit=limit, regex=regex
        )
    else:

        # need a non-zero len on all axes
        if not self.size:
            return self

        new_data = self._data
        if is_dict_like(to_replace):
            if is_dict_like(value):  # {'A' : NA} -> {'A' : 0}
                res = self if inplace else self.copy()
                for c, src in to_replace.items():
                    if c in value and c in self:
                        # object conversion is handled in
                        # series.replace which is called recursively
                        res[c] = res[c].replace(
                            to_replace=src,
                            value=value[c],
                            inplace=False,
                            regex=regex,
                        )
                return None if inplace else res

            # {'A': NA} -> 0
            elif not is_list_like(value):
                keys = [(k, src) for k, src in to_replace.items() if k in self]
                keys_len = len(keys) - 1
                for i, (k, src) in enumerate(keys):
                    convert = i == keys_len
                    new_data = new_data.replace(
                        to_replace=src,
                        value=value,
                        filter=[k],
                        inplace=inplace,
                        regex=regex,
                        convert=convert,
                    )
            else:
                raise TypeError("value argument must be scalar, dict, or Series")

        elif is_list_like(to_replace):  # [NA, ''] -> [0, 'missing']
            if is_list_like(value):
                if len(to_replace) != len(value):
                    raise ValueError(
                        f"Replacement lists must match in length. "
                        f"Expecting {len(to_replace)} got {len(value)} "
                    )

                new_data = self._data.replace_list(
                    src_list=to_replace,
                    dest_list=value,
                    inplace=inplace,
                    regex=regex,
                )

            else:  # [NA, ''] -> 0
                new_data = self._data.replace(
                    to_replace=to_replace, value=value, inplace=inplace, regex=regex
                )
        elif to_replace is None:
            if not (
                is_re_compilable(regex)
                or is_list_like(regex)
                or is_dict_like(regex)
            ):
                raise TypeError(
                    f"'regex' must be a string or a compiled regular expression "
                    f"or a list or dict of strings or regular expressions, "
                    f"you passed a {repr(type(regex).__name__)}"
                )
            return self.replace(
                regex, value, inplace=inplace, limit=limit, regex=True
            )
        else:

            # dest iterable dict-like
            if is_dict_like(value):  # NA -> {'A' : 0, 'B' : -1}
                new_data = self._data

                for k, v in value.items():
                    if k in self:
                        new_data = new_data.replace(
                            to_replace=to_replace,
                            value=v,
                            filter=[k],
                            inplace=inplace,
                            regex=regex,
                        )

            elif not is_list_like(value):  # NA -> 0
                new_data = self._data.replace(
                    to_replace=to_replace, value=value, inplace=inplace, regex=regex
                )
            else:
                raise TypeError(
                    f'Invalid "to_replace" type: {repr(type(to_replace).__name__)}'
                )

    if inplace:
        self._update_inplace(new_data)
    else:
        return self._constructor(new_data).__finalize__(self)

