    self: FrameOrSeries, periods=1, freq=None, axis=0, fill_value=None
) -> FrameOrSeries:
    if periods == 0:
        return self.copy()

    block_axis = self._get_block_manager_axis(axis)
    if freq is None:
        new_data = self._data.shift(
            periods=periods, axis=block_axis, fill_value=fill_value
        )
